  `parent1_phone` varchar(255) NOT NULL DEFAULT '' COMMENT '家长1电话',
  `parent2_name` varchar(255) NOT NULL DEFAULT '' COMMENT '家长2姓名',
  `parent2_idcard` varchar(255) NOT NULL DEFAULT '' COMMENT '家长2身份证号码',
  `parent2_birth` varchar(255) NOT NULL DEFAULT '' COMMENT '家长2出生年月',
