/*Table structure for table `stud_student` */

DROP TABLE IF EXISTS `stud_student`;

CREATE TABLE `stud_student` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `openid` varchar(255) NOT NULL DEFAULT '' COMMENT '微信ID',
  `name` varchar(255) DEFAULT '' COMMENT '名称',
  `code` varchar(255) DEFAULT '' COMMENT '学号',
  `sex` tinyint(3) NOT NULL DEFAULT '0' COMMENT '性别，1男，2女，0未知',
  `idcard` varchar(255) NOT NULL DEFAULT '' COMMENT '身份证号',
  `phone` varchar(255) DEFAULT '' COMMENT '电话',
  `native` varchar(255) DEFAULT '' COMMENT '户籍所在地',
  `domicile` varchar(255) NOT NULL DEFAULT '' COMMENT '户籍所在详细地址',
  `addr` varchar(255) DEFAULT '' COMMENT '现居住地',
  `qq` varchar(255) DEFAULT '' COMMENT 'QQ',
  `birth` varchar(255) DEFAULT '' COMMENT '出生日期',
  `nation_id` tinyint(3) DEFAULT '0' COMMENT '民族ID',
  `accounttype` tinyint(3) DEFAULT '0' COMMENT '户口类型：0农业户口、1非农业户口、2集体户口',
  `political` tinyint(3) DEFAULT '0' COMMENT '政治面貌：0团员，1党员，2群众',
  `email` varchar(255) DEFAULT '' COMMENT '邮箱',
  `photo` varchar(255) DEFAULT '' COMMENT '个人相片',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `creator` int(11) NOT NULL DEFAULT '0' COMMENT '创建人',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `updator` int(11) NOT NULL DEFAULT '0' COMMENT '更新人',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='学生基本信息';

