/*Table structure for table `wx_news` */

DROP TABLE IF EXISTS `wx_news`;

CREATE TABLE `wx_news` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '资讯类型:0本站，1外站',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '标题',
  `url` varchar(255) DEFAULT '' COMMENT '外站URL',
  `category_id` int(10) NOT NULL DEFAULT '0' COMMENT '资讯类别ID',
  `abstract` varchar(255) NOT NULL DEFAULT '' COMMENT '摘要',
  `content` longtext COMMENT '内容',
  `thumb` varchar(255) NOT NULL DEFAULT '' COMMENT '缩略图',
  `attachment` varchar(255) DEFAULT '' COMMENT '附件URL',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `creator` int(11) NOT NULL DEFAULT '0' COMMENT '创建人',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `updator` int(11) NOT NULL DEFAULT '0' COMMENT '更新人',
  `views` int(11) NOT NULL DEFAULT '0' COMMENT '浏览次数',
  `tags` varchar(500) DEFAULT '' COMMENT '标签，指的是三级分类',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8 COMMENT='网站资讯';

