insert  into `wx_news`(`Id`,`type`,`title`,`url`,`category_id`,`abstract`,`content`,`thumb`,`attachment`,`create_time`,`creator`,`update_time`,`updator`,`views`,`tags`) values (30,1,'papi酱','',14,'巅峰时代','','http://7xsqzj.com2.z0.glb.qiniucdn.com/FvcDo3YP2HzMprkYvYFq2TWsuJ1G','',1461325728,2,1461393020,0,1,'但是'),(31,1,'i酱让越来越多品牌开始接受新的','http://xudanei.baijia.baidu.com/article/421794',6,'电饭锅','','http://7xsqzj.com2.z0.glb.qiniucdn.com/FpZ98R4O5UaTYxacoBkbUnnhuhIp','',1461325858,2,1461325858,2,0,'的,发'),(32,1,'laiziceshi','baidu.com',7,'ssssssssssssssssa','','http://7xsqzj.com2.z0.glb.qiniucdn.com/FiIngmzYUZZlM3WXyi3KfNw2kEce','/Public/Upload/file/2016-04-22/571a109da7d72.jpg',1461325981,0,1461325981,0,0,'baidu'),(33,1,'以中国电影市场托底的阿里影业，','http://wangliyang.baijia.baidu.com/article/421679',5,'胜多负少','','http://7xsqzj.com2.z0.glb.qiniucdn.com/FpZ98R4O5UaTYxacoBkbUnnhuhIp','',1461325994,2,1461325994,2,0,'速度'),(34,0,'为什么不aaaaa','',5,'士大夫','<p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">看来去年《碟5》在中国市场取得8.68亿的票房让派拉蒙很是满意，今年下半年的两部大片《忍者神龟2》与《星际迷航：超越星辰》也选择了继续与阿里影业合作。实际上，中国市场每年引进的好莱坞电影基本都可以对票房有个大致预期，那些题材好、粉丝多的影片完全是稀缺资源。中国公司拿到国内的宣发经营权并不是那么容易，阿里影业好不容易与派拉蒙建立起来的蜜月关系必然会长期维护下去。因为无论是《忍者神龟2》还是《星际迷航：超越星辰》，阿里影业在这两部影片中必然也能拿到丰厚的回报。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">当然，如果从阿里集团来讲，并不在意从《碟5》中获取的6870万全球分成收入，但阿里影业是独立上市公司，对财务表现有要求，而且以去年阿里影业的营收占比来看，与派拉蒙合作电影的全球票房分成仍是其短期内的重点收入项之一。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">与派拉蒙维持稳定的合作关系可以带来一定的营收只是其中一点而已，更为重要的是阿里影业可以借由与派拉蒙合作的成功案例来吸引其他五大好莱坞电影公司。在美国电影市场疲软，中国电影市场爆发的大环境下，包括环球影业和华纳兄弟公司在内的电影公司都已经与中国的影业和媒体公司结成合作关系。对于阿里影业而言，先在国际电影市场占据一定地位是国际化战略的关键一步。</p><p><br/></p>','http://7xsqzj.com2.z0.glb.qiniucdn.com/FgYkyP0fsmYciTSfqql8JKFoOMj6','',1461327226,2,1461386106,0,5,'we'),(35,0,'小米不是手机公司','',3,'谁是独角兽》：小米去年增速放缓，估值也被认为缩水。小米最新发布的小米5尊享版定价为2699元，一改往日极具性价比的做法（以前最高端手机锁定在1999元）。你怎么看小米5这款产品？','<p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">在日前举办的“2016年中国投资年会”上，刘芹接受了《谁是独角兽》的专访。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">作为小米早期（A轮和B轮融资）投资人、雷军的好友，刘芹直面小米去年增长性缓慢引起外界对其估值存疑的问题，也解释了小米融资和上市的事宜。雷军曾在一次访问中谈到，“原来我们手机准备叫大米，后来刘芹说不能高大全，就变成小米了。”今年2月，两人还一起去滑雪。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">作为顶尖的投资大佬，刘芹也分享了对TMT行业趋势性的判断。在他看来，中国下一步创业机会和投资机会首先在寻找新的结构性的有效增量。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; font-style: inherit; font-variant: inherit; font-weight: 800; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: antialiased;\">以下是专访实录（有删节）：</span></p><h2 style=\"margin: 25px 0px 20px; padding: 0px; font-stretch: inherit; font-size: 14px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: antialiased;\">《谁是独角兽》：小米去年增速放缓，估值也被认为缩水。小米最新发布的小米5尊享版定价为2699元，一改往日极具性价比的做法（以前最高端手机锁定在1999元）。你怎么看小米5这款产品？</span></h2><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">刘芹：2015年，小米的竞争对手都成长得非常快，小米面临的竞争特别激烈，这种压力在我看来是一种好事，它会逼着小米在整个能力上有所提升。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">小米过去在性价比的思路上，走到了市场很极致的位置。停在这边肯定是不行的，所以小米肯定会在这上面增加差异化。小米每一代产品都是过去几年的积累所带来的，2015年的产品是2014年定型的。我桌子上有从第1代到第5代的产品，如果你仔细比较每一代产品，他们都有非常大的进步。所以，好的公司最重要的是每年要比自己的过去，哪怕每次只有微小的进步，但是这种微小的进步经过长期的积累可以带来很好的效应。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">小米在整个下一代的科技上的部署和策略上做了非常多的</p><p><br/></p>','http://7xsqzj.com2.z0.glb.qiniucdn.com/FiiTd3uOy8oisb7vkuV6_3R0UHZR','',1461327524,2,1461327524,2,2,'小米'),(36,0,'谁垄断了APP测试80%市场','',14,'中国约有200万款APP，其中160万款用Testin的测试服务，市场覆盖率超过了80%，基本形成这个领域的事实垄断者。','<p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">中国约有200万款APP，其中160万款用Testin的测试服务，市场覆盖率超过了80%，基本形成这个领域的事实垄断者。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">2003年已获得财务自由、2010年又以9000万美元卖掉一家公司的Testin创始人兼董事长蒋晓海，在这家移动应用云测试公司上寄托了他更大的梦想：“如果移动开发者未来能挣到钱，能主宰世界，Testin就有机会跟他们一起改变世界。”</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">2004年手机初具移动互联网雏形，在这个“伪移动互联网时代”，很多创业者投入游戏、音乐的开发中，蒋晓海选择了即时通讯：“一个真正能得到大家接受和喜欢的杀手级应用一定关注人与人之间的沟通和分享。”因此，他和他的创业伙伴一块做了PICA，一款能在PC端和移动端进行即时通讯的手机软件。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">但是，这款产品做得太早了：属于智能手机的移动互联网时代还没有爆发。并且，他们还需要面对来自腾讯的竞争。2010年，PICA被卖给了中软国际。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">2011年，蒋晓海找到王军他们，说PICA因为时间窗口不对，没有成。“我们一定要干一件能成的事，做一件对整个产业有价值的事。”他觉得自己创业摔在了很多坑里，这次要做帮助创业者的事，并且不是大事而是小事。“现在来看，（蒋晓海）他是对的，创业确实要专注在一件小事上，专注在一个刚性需求上。”Testin联合创始人兼CEO王军说。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">他们回想起当年做测试的痛苦，决定从测试做起：测试足够小、足够专。更迭迅速的移动APP，测试这个环节需要购入大批设备，设立管理团队来负责评测，需要人力在每台手机上运行应用，效率低、成本大。蒋晓海萌生出搭建一个平台把自己的设备和测评技巧提供给大家，节省成本：“(开发者自行购买设备进行评测)是愚蠢的，我就要解决这类事。”</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">测试同时是足够大的市场，因为移动互联网终端兴起，未来是靠软件驱动，而不是硬件驱动。移动应用软件的测试也从以企业为单位交付，变成以团队、甚至以个人为单位交付。在移动互联网以前，可能市面上的软件有几十万款，做软件的企业有几万个；但是移动互联网爆发之后，中国至少有几十万开发者，几百万款软件。而且，这仅仅是手机上的，现在智能家居、可穿戴设备、汽车、AR和VR等等都需要做应用测试。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">王军说：“钱钟书有本书叫《管锥编》，要用管子看天，用锥刺地，只有这样你才能发现大千世界的微妙之处，你才能够足够深入。如果你用一个球砸地，只能砸一个坑，只有用锥刺地，才能刺进去”。2011年，几位联合创始人共同出资，成立Testin。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\">2011年9月，Testin A轮融资拿到了来自&nbsp;IDG的990万美金。“蒋晓海是上一个投资项目的创业者，公司卖给了上市公司，项目不能说失败，也不能说成功。我们了解他的性格、人品，也相信他能做更大的事情。”IDG合伙人林栋梁说。</p><p class=\"text\" style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-stretch: inherit; font-size: 14px; line-height: 24px; font-family: arial, &#39;Hiragino Sans GB&#39;, 微软雅黑, MicrosoftYaHei, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti; vertical-align: baseline; -webkit-font-smoothing: antialiased; text-indent: 28px; color: rgb(51, 51, 51); letter-spacing: 0.5px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; font-style: inherit; font-variant: inherit; font-weight: 800; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: antialiased;\">2</span></p><p><span style=\"margin: 0px; padding: 0px; font-style: inherit; font-variant: inherit; font-weight: 800; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: antialiased;\"><br/></span></p><p><br/></p>','http://7xsqzj.com2.z0.glb.qiniucdn.com/Fm0OQJitj6gziYdBwrtGLV27C-JB','',1461327648,2,1461327648,2,8,'速度'),(40,1,'不得不服!!大学生48天居然能','http://ecar.baijia.baidu.com/article/419680',14,'的是法国','','http://7xsqzj.com2.z0.glb.qiniucdn.com/Fm0OQJitj6gziYdBwrtGLV27C-JB','',1461327891,2,1461327891,2,0,'ds'),(41,0,'但是从','',2,'豆腐干地方','<p>地方官梵蒂冈电饭锅地方法国德国</p>','http://7xsqzj.com2.z0.glb.qiniucdn.com/FnS7sYHNa_fiQ5gHtgBUk7ZEH9o0','/Public/Upload/file/2016-04-22/571a334d1cc22.jpg',1461329714,2,1461334861,0,1,'电视'),(43,0,'这是附件','',5,'这是附件这是附件这是附件这是附件','<p>这是附件这是附件这是附件这是附件这是附件这是附件这是附件</p>','http://7xsqzj.com2.z0.glb.qiniucdn.com/FhhjHo6i-S5EKM44TKCWzsrwh-6u','/Public/Upload/file/2016-04-22/571a232d2d4b6.doc',1461330733,0,1461330733,0,3,'这是附件'),(46,0,'发xian','',5,'发','<p>电饭锅</p>','http://7xsqzj.com2.z0.glb.qiniucdn.com/Fg6a1jycse2yeucP1X6ww1zhIOj5','',1461379115,2,1461384943,0,0,'地方'),(47,0,'但是','',14,'sdfsdfsdf','<p>sdfsdf</p>','http://7xsqzj.com2.z0.glb.qiniucdn.com/FicwOvkDTiuUeF-tTH0oMhuBHhC4','/Public/Upload/file/2016-04-23/571b0c3f57ebf.jpg',1461390399,2,1461390415,2,0,'不能'),(48,1,'最新招聘信息','',11,'11','','http://7xsqzj.com2.z0.glb.qiniucdn.com/FsLYZ3EoNyex0CAk0YGl0Y_1GFhZ','',1461392871,2,1461414971,2,6,'就业,招聘'),(49,0,'宝贝','',12,'嗯嗯嗯嗯嗯嗯$(\'.dropify-clear\').text(\"移除\")','<p>111111111111111111111</p>','http://7xsqzj.com2.z0.glb.qiniucdn.com/Fm6b4m28dRASLQRT4HbeAQUutoQw','/Public/Upload/file/2016-04-23/571b1af07015d.jpg',1461394160,0,1461414965,2,0,'宝贝,么么哒'),(51,0,'喂wee','',14,'问问','<p>问问</p>','http://7xsqzj.com2.z0.glb.qiniucdn.com/FpNEzMDc4KvoNilTwEdI31a3S7Ty','/Public/Upload/file/2016-04-24/571c9a3de67f6.jpg',1461492285,0,1461492285,0,2,'人人人r'),(53,0,'sdsd','',13,'sdsd','<p>sdsds</p>','http://7xsqzj.com2.z0.glb.qiniucdn.com/FvW0e1TJTEGJe6xZE4BK6qWUWKzF','',1461492515,0,1461594408,0,0,'ass');

/*Table structure for table `wx_offers` */

DROP TABLE IF EXISTS `wx_offers`;

CREATE TABLE `wx_offers` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '岗位名称',
  `addr` varchar(255) NOT NULL DEFAULT '' COMMENT '工作地点',
  `salary` tinyint(3) NOT NULL DEFAULT '0' COMMENT '期望薪水，默认0面仪',
  `number` int(11) NOT NULL DEFAULT '1' COMMENT '招聘人数',
  `education` tinyint(3) NOT NULL DEFAULT '0' COMMENT '学历要求，默认0不限',
  `worklife` tinyint(3) NOT NULL DEFAULT '0' COMMENT '工作年限，默认0不限',
  `welfare` varchar(500) DEFAULT '' COMMENT '福利待遇,逗号分隔',
  `content` text NOT NULL COMMENT '内容',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `creator` int(11) NOT NULL DEFAULT '0' COMMENT '创建人',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间（发布时间）',
  `updator` int(11) NOT NULL DEFAULT '0' COMMENT '更新人',
